import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header className="Header"/>
    </div>
  );
}

function Header(){

  return(
    <>
     <div className="w3-bar w3-white w3-border-bottom w3-xlarge">
     <a href={"www.google.com"} className="w3-bar-item w3-button w3-text-red w3-hover-red"><b><i className={"fa fa-map-marker w3-margin-right"}></i>GenoRec</b></a>

    </div>
    </>
  )
}

export default App;
